import { createRouter } from 'vue-router';
import register from '@/views/RegisterForm.vue';
import login from '@/views/LoginForm.vue';
import home from '@/views/Home.vue';
import route from './session_routes';


const routes = [

  {
    path: '/register',
    name: 'Register',
    component: register,
    meta:{
      auth:true
    }
  },
  {
    path: '/login',
    name: 'Login',
    component: login
  },
  {
    path: '/',
    name: 'Home',
    component: home
  },
];

routes.beforeEach(route);
export default routes;
